import React from "react";
import { Link } from 'react-router-dom'
import "./style.scss";

function Project({ className, title, desc, image }) {
	return (
		<Link to="/hult-edu">
			<div className={`project ${className}`}>
				<img src="" alt="" title="" />
				<p>{title}</p>
				<p>{desc}</p>
			</div>
		</Link>
	);
}

export default Project;
